import * as React from 'react';
import Card from '@mui/material/Card';
import CardHeader from '@mui/material/CardHeader';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

import Avatar from '@mui/material/Avatar';

import Image from "../imgExample/frog.png";
import Song from "../imgExample/songvatar.png";

export default function GridContent() {
  return (
    <Card sx={{ maxWidth: 345 }}>
      <CardMedia
        component="img"
        height="140"
        image={Image}
        alt="green iguana"
      />
      <CardContent>
        <Typography gutterBottom variant="h6" component="div">
          [유미의 세포들] 웅며드는 과정
        </Typography>
        CardHeader sx={{marginTop: 2, marginBottom: -2}}
        avatar={
          <Avatar sx={{ width: 24, height: 24}} aria-label="recipe"  src={Song}/>
        }
        title={<Typography variant="body1" color="text.primary" sx={{ ml: -1}}>
            효림 ∙ 2h
        </Typography>}
      />
        <Avatar sx={{ width: 20, height: 20}} aria-label="recipe"  src={Song}/>
        <Typography variant="body2" color="text.secondary">Zoey</Typography>


        <Typography variant="body2" color="text.secondary">

          Lizards are a widespread group of squamate reptiles, with over 6,000
          species, ranging across all continents except Antarctica
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small">Share</Button>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>
  );
}
